;; @@
(def plot (function-plot sin (* -2 Math/PI) (* 2 Math/PI)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/plot</span>","value":"#'user/plot"}
;; <=

;; @@
(doto plot
  (add-pointer (- Math/PI) (sin (- Math/PI)) 
               :text "(-pi, (sin -pi))")
  (add-pointer Math/PI (sin Math/PI) 
               :text "(pi, (sin pi))" :angle :ne)
  (add-pointer (* 1/2 Math/PI) (sin (* 1/2 Math/PI)) 
               :text "(pi/2, (sin pi/2))" :angle :south))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-unkown'>#object[org.jfree.chart.JFreeChart 0x5721d4eb &quot;org.jfree.chart.JFreeChart@5721d4eb&quot;]</span>","value":"#object[org.jfree.chart.JFreeChart 0x5721d4eb \"org.jfree.chart.JFreeChart@5721d4eb\"]"}
;; <=

